Fix to allow strict checking of properties.  (Maybe we should change the title?)

We have introduced a new property
{code}
cloudformation.enforce_strict_resource_properties=true
{code}

which when enabled, will fail both of the following stacks:
{code}
{
  "Resources" : {
    "SG1" : {
      "Type" : "AWS::EC2::SecurityGroup",
      "Properties" : {
        "GroupDescription" : "foo"
      },
      "Tags" : "DependsOn"
    }
  }
}
{code}

{code}
{
  "Resources" : {
    "SG1" : {
      "Type" : "AWS::EC2::SecurityGroup",
      "Properties" : {
        "GroupDescription" : "foo",
        "SecurityGroupIngress":[ { "IpProtocol":"tcp", "FromPort":"22", "ToPort":"23", "CidrIp":"0.0.0.0/0" } ],
        "DependsOn" : "Tags"
      }
    }
  }
}
{code}

Specifically, if there is a 'property' in the resource "Properties": field that Eucalyptus does not know about, or if there is any json key in a resource except:

    Type,
    Properties,
    DeletionPolicy,
    Description,
    DependsOn,
    Metadata,
    UpdatePolicy,
    CreationPolicy,
    Condition

Stack creation or update will fail.  (It will not fail to load previously created stacks, just in case they were put in before the property was set).

This is both an AWS compatibility issue and to avoid mistakes like putting "Tags" outside the Properties section or "DependsOn" inside it.

[~sjones]  This is a fix for an issue found in this bug, but kind of buried here.  Should we file a new bug, or maybe change the title?
